// NavigationBar.js

import React, { useState } from "react";

const NavigationBar = ({ handleDirection }) => {
  const [startPoint, setStartPoint] = useState("");
  const [endPoint, setEndPoint] = useState("");

  const handleStartPointChange = (e) => {
    setStartPoint(e.target.value);
  };

  const handleEndPointChange = (e) => {
    setEndPoint(e.target.value);
  };

  const handleDirectionClick = () => {
    handleDirection(startPoint, endPoint);
  };

  return (
    <div className="navigation-bar">
      <h3>Navigation</h3>
      <label htmlFor="start">Start Point:</label>
      <select id="start" value={startPoint} onChange={handleStartPointChange}>
        <option value="building 1">building 1</option>
        {/* Add more options if needed */}
      </select>
      <label htmlFor="ens">End Point:</label>
      <select id="s" value={endPoint} onChange={handleEndPointChange}>
        <option value="building 2">building 2</option>
        {/* Add more options if needed */}
      </select>
      <button onClick={handleDirectionClick}>Show Directions</button>
    </div>
  );
};

export default NavigationBar;
